import React from "react";
import Navbarprofile from "../../Components/Navbarprofile/Navbarprofile";
import Navprofile from "../../Components/navprofile/Navprofile";
import { Box } from "@mui/system";
import { blue } from "@mui/material/colors";
import { useState } from "react";
import "./Profile.css";

import {
  MDBCol,
  MDBContainer,
  MDBRow,
  MDBCard,
  MDBCardBody,
  MDBCardImage,
  MDBBtn,
  MDBTypography,
  MDBCardText,
} from "mdb-react-ui-kit";
import { Collapse } from "mdbreact";
import { Grid } from "@mui/material";
const Profile = () => {
  return (
    <Box sx={{ display: "flex", height: "100vh" }}>
      <Box sx={{ position: "fixed", top: 0, zIndex: 1 }}>
        <Navbarprofile />
      </Box>

      <Box sx={{ zIndex: 1, position: "fixed" }}>
        <Navprofile />
      </Box>
      <Grid
        container
        spacing={3}
        direction="row"
        justifyContent="center"
        alignItems="center"
        sx={{ backgroundColor: "green" }}
      >
        <Grid
          direction="column"
          xs={12}
          sx={{
            //dispaly: "flex",
            //alignItems: "center",
            backgroundColor: "red",
            //height: "300px",
          }}
        >
          <p>xs=8</p>
          <p>xs=8</p>
          <p>xs=8</p>
          <p>xs=8</p>
          <p>xs=8</p>
        </Grid>
        <Grid
          direction="column"
          xs={12}
          sx={{
            //dispaly: "flex",
            //alignItems: "center",
            backgroundColor: "blue",
            //height: "300px",
          }}
        >
          <p>xs=8</p>
          <p>xs=8</p>
          <p>xs=8</p>
          <p>xs=8</p>
          <p>xs=8</p>
        </Grid>
        <Grid
          direction="column"
          xs={3}
          sx={{
            //dispaly: "flex",
            //alignItems: "center",
            backgroundColor: "yellow",
            //height: "300px",
          }}
        >
          <p>xs=8</p>
          <p>xs=8</p>
          <p>xs=8</p>
          <p>xs=8</p>
          <p>xs=8</p>
        </Grid>
      </Grid>
    </Box>
  );
};

export default Profile;
